INSERT INTO `interview` (`uoh_no`, `candidate_name`, `company_name`, `course`, `job_profile`, `description`, `s_no`, `reported_interview`) VALUES
('18MCMC33', 'Pallavi Kumari', 'TCS ', 'MCA', 'SYSTEM ENGINEER', '\r\nHr round ::\r\nSome general questions related to interest , family background, educational background\r\n\r\nTR round ::\r\n\r\nAsked technical questions including \r\n   normalization,c++,java(oops concept, exception handling, differences)\r\n\r\nMR Round::\r\nCodevita questions discussion\r\nProject discussion (a little bit)\r\n2 coding questions based on array and linked list \r\nLatest technologies if know(big data and distributed computing)\r\n', 10, 0),
('18MCMC52', 'Subham Singh', 'JACOTA', 'MCA', 'SOFTWARE ENGREEER', '1) how was your day today?\r\n3)Are you know about Cloud Computing?\r\n4) project discussion in deap?\r\n5) my project in java so started java Question?\r\n6)Garbage collector?\r\n7) Null pointer exception?\r\n8)Access modifier?\r\n9)jvm vs jdk?\r\n10)c++ vs java ?\r\n11) again project Dissucisson?\r\n12)Morque tag in html?\r\n13)diff b/w div and span tag?\r\n14)method overiding?\r\n15)explicit datatype?\r\n16)switch case exmaple?\r\n17)Why we do data cleaning?\r\n18)bitcoins and Blockchain?\r\n19)project run and share screen?\r\n18)write code on notepad take input from user side and print it is integer or char?\r\n19)ascci char range ?\r\n18)write code of codevita?\r\n19)have you chance from campus for tcs Digital?\r\nHR\r\n1)tell me about yourself?\r\n2)rate your self?\r\n3)what you will  do if we noy hire today?\r\n4)what you will do if we hire today?\r\n5)team player role?\r\n6)if your have five task and complete it tommorow 2-task have complete information and 3-task have not complete information what will your priority to solve task?(10 min discussion).\r\n7)any Question for us?\r\n', 11, 0),
('18MCMC40', 'Vimlendra Dubey ', 'TCS', 'MCA', 'SYSTEM ENGREER', 'HR Round: -\r\n1.	Tell me about yourself.\r\n•	What’s your plan?\r\n•	Your family background.\r\n•	Your strength.\r\n•	Your hobbies.\r\n2.	Which technology you know?\r\n3.	What you do in this lockdown?\r\n4.	What you know about TCS?\r\n5.	What type of services TCS provide?\r\n6.	What you know about cloud computing?\r\n\r\nTR Round: -\r\n1.	Which language you know? \r\nI replied C++. He asked all the questions form C++.\r\n2.	C++ is procedural programming language or object oriented programming language?\r\n3.	What are the differences between PPL and OOPL?\r\n4.	What are the things that make c++ object oriented programming language?\r\n5.	Inline Function\r\n6.	Difference b/w global and local variable.\r\n7.	Type of inheritance\r\n8.	Copy constructor\r\n9.	Is it necessary to declare constructor into the program?\r\n10.	Virtual function\r\n11.	Static variable and static function\r\nMR Round: -\r\n1.	Do you have any project?\r\n2.	Explain any one of your project.\r\n3.	some questions from your project and language/technology you used.\r\n4.	Which question you did in Codevita?\r\n5.	Explain Approach that you used.\r\n6.	Do you have any question for me?\r\n', 12, 0),
('18MCMC12', 'Nitesh Raval ', 'TCS', 'MCA', 'SYSTEM ENGINEER', 'My slot timing given as 4:15pm but hr called me 40 min before on call and started interview\r\n1.	Tell me something about yourself\r\nAnswered ….. as I have mention participation in Login2k19 and won one event so they ask me about problem given in fractal fanatic and approach to solve…. I answered it\r\n2.	He asked me TCS codevita Problem and its approach to solve………answered \r\n3.	Why did you choose c++ and what are set & map as I have used cpp stl to implement codevita problem and also he asked internal implementation of set and map………answered\r\n4.	Then he asked which is your favourite programming language….answered c++ \r\n5.	He asked me to share the screen and open notepad and ask\r\nWhat is This pointer and auto pointer in cpp also write code of it in notepad \r\nWhat is call by value call by reference ?\r\nThen He tell me to open codeblock & gives me a problem to code & compile\r\nProblem: check wheather a given number is ugly number or not ugly are those number whose prime factor are 2, (3or 5). In range of 1 to 100\r\n Answered…. I use recursive approach to solve it \r\n6.	They asked me java oops concept what is final keyword polymorphism , use of super keyword……..all answered \r\n7.	Then he asked me to give rating out of 5 in cpp& java ….. answered\r\n8.	After that MR asked me have you done any project in BCA final year……. I explain but he didn’t asked anything in that project\r\n9.	He told me any other project …….i answered by explaining my ML project.\r\n10.	After that he asked me lots of question from machine learning ……why did you use K-means over C-means …answered then he asked me About K-means clustering algorithm ….i told him approach but he said to code by sharing screen again in notepad as I use to of ide so I unable to code properly but I explain sudo code\r\n11.	What is the difference b/w supervised unsupervised reinforcement learning ……… answered \r\n12.	And also he gives me an usecase to determine which algorithm will be applied on it ….. not able to analyze because they have not given  any input or output…..\r\n13.	Some DBMS question to find 2nd  higest salay of employee …. Answered\r\n14.	At last he asked me for my area of interest….i told ML so he tell rate yourself in ML ….answer \r\n15.	Interview completed he asked any question… \r\nNo hr question were asked ………\r\n\r\n', 13, 0),
('18MCMC46', 'Manish Kumar ', 'TCS', 'MCA', 'SYSTEM ENGINEER', 'Technical Round 1:\r\n•	Coding Questions:\r\n1)	Program to print n lines of Pascal’s triangle with space optimization.\r\n2)	Remove duplicate elements from an unsorted array.\r\n3)	Find the middle of a linked list in one traverse.\r\n4)	You are given 1-100 numbers in an array and 1 number is missing, find that number.\r\n5)	Implement a queue using two stacks.\r\n\r\n•	Overview of my projects.\r\n•	Oops concepts of java.\r\n•	Exception Handling.\r\n•	What is use of finally block.\r\n•	Difference between Exception and Error.\r\n•	RESTful API’s.\r\n•	HTTP functions.\r\n\r\nTechnical Round 2:\r\n•	Coding Questions:\r\n1)	You are given a string of numbers like “12”, You have to find the number of ways so we can convert the numbers into letters.\r\nExample:\r\n		Input: “12”\r\n		Output: 3\r\n		Explanation:\r\n1 can be written as ‘A’, 2 can be written as ‘B’ and ‘12’ together can be written as ‘L’ so there are 3 ways.\r\n		You have to use backtracking.\r\n2)	Swap a linked list in pairwise but you should change the links not the data of linked list.\r\n3)	Check if a binary tree is Symmetric or no\r\n4)	Flatten a binary tree into Linked List\r\n•	Any other projects that I have not mentioned in my resume.\r\n•	Java Theory:\r\ni)	What are threads.\r\nii)	What is Synchronization.\r\niii)	How will you achieve Synchronization?\r\niv)	How Synchronization works in background.\r\nv)	Oops Concepts\r\nvi)	Real world example of Oops Concept except Car example.\r\nvii)	Many small questions from java, I don’t remember.\r\n\r\n•	Operating System:\r\ni)	Mutex vs Semaphores.\r\nii)	Why do we use scheduling?\r\niii)	What is round robin.\r\niv)	Multiprocessing v/s multiprogramming v/s Multitasking. \r\n\r\n\r\n\r\n\r\n\r\n\r\n', 14, 0),
('18MCMC65', 'RAMDEV PANDEY', 'JACOTA', 'MCA', 'ASSOCIATE SOFTWARE ENGINEER', 'Q1. tell me about yourself.\r\nQ2. tell me about your project\r\nQ3. what language do you know ?\r\nQ4. what is encapsulation ?\r\nQ5. what is polymorphism in java ?\r\nQ6. what is difference between throw and throws in java?\r\nQ7. what is difference between Final and Finally in java ?\r\nQ8. problem that you couldn\'t solved. did you try to solve them latter ?\r\nQ9. do you know any latest technology. are you flexible to work as any role in jacota?\r\nQ10. suppose there is a group project your task is dependent on your teammate task, you cannot start your task until your teammate complete. what will you do if your teammate is doing his task.\r\nQ11. suppose you there is some problem in mainframe computer because of that you can\'t do your work and you don\'t know anything about mainframe repair. what will you do ?\r\n\r\nQ12. Describe public static void main(string args[])\r\n', 16, 0);

